import { Link } from 'react-router-dom'

function MoviePoster(props) {
    const link = 'https://image.tmdb.org/t/p/original'

    return (
        <Link to={'movie/' + props.data.id} className="movie-poster">
            <img src={link + props.data.backdrop_path} alt="" className="movie-poster-img" />
            <h1 className="movie-poster-title">{props.data.title}</h1>
        </Link>
    )
}

export default MoviePoster;
